Zepto(function(){function imgSwipe(s){var p=null,r=Zepto("#"+s),n=r.children().eq(0).find("img"),q=r.children().eq(1).find("div"),l=n.length,o=l-2,m=1;for(var i=0;i<n.length;i++){var dot=document.createElement("span");dot.className="dotItem";q[0].appendChild(dot)}var v=q.eq(0).find("span");v.eq(0).addClass("selected");p=new Swipe(document.getElementById(s),{startSlide:0,auto:4000,speed:300,callback:function(t,u){v.removeClass("selected").eq(t).addClass("selected")}})}function tabSwipe(cfg_k){var m=null;var o=Zepto("#"+cfg_k);var e=document.createElement("DIV");e.innerHTML=o[0].innerHTML;o[0].innerHTML="";o[0].appendChild(e);var n=o.prev().children().children();var l=n.eq(0).find("span");if(n.length==2&&!n.eq(0).is("span")){var t=n;if(l.length==0){var spele=document.createElement("span");n[0].appendChild(spele)}n=o.prev().find("span");n[0]=t[0]}else{n=o.prev().find("span")}m=new Swipe(document.getElementById(cfg_k),{startSlide:0,speed:300,callback:function(r,s){if(r>=n.length){r=r-n.length;}if(n.length>1){n.removeClass("blueline");n.eq(r).addClass("blueline")}}});Zepto(document).on("click tap",n,function(){if(Zepto(this).hasClass("blueline")){return}var q=n.index(this);m.slide(q,200)})}function scrollTab(){for(cfg_k in tab_config){tabSwipe(cfg_k)}}imgSwipe("img_scroll");scrollTab()});